buffer.push('<h2>O acordo entre o buscador e o servidor</h2>\n\n\n<strong>Com o objetivo de indexar aplicações ricas, surgem algumas perguntas:</strong>\n\n<ul>\n  <li>Quais URL ajax podem ser indexadas?</li>\n  <li>Como exibir a URL?</li>\n  <li>Como poderia funcionár a logística</li>\n</ul>\n\n<p>Pensando nisso teriamos o seguinte acordo entre o web server e os motores de busca.</p>\n\n<p><strong>Web server concorda com</strong></p>\n<ul>\n  <li>Indicar quais URLs serão indexáveis</li>\n  <li>Executar javascript para urls feia (sem user agent sniffing)</li>\n  <li>não encobrir por sempre dando mesmo conteúdo para o navegador e rastreador, independentemente do pedido (ou risco eliminatin, como antes)</li>\n</ul>\n\n\n<p><strong>Os motores de busca concordam com</strong></p>\n<ul>\n  <li>Descobrir urls como antes (sitemaps, hyperlinks)</li>\n  <li>Modificar urls bonitas para urls feias</li>\n  <li>Indexar conteúdo</li>\n  <li>Exibir URLs originais</li>\n</ul>\n\n\n<p>A fim de tornar suas aplicações AJAX rastreáveis​​, o seu site precisa obedecer algumas regras que baseia-se no seguinte:</p>\n\n<ol>\n  <li>O site adota o esquema de rastreamento de AJAX.</li>\n  <li>Para cada URL que tem conteúdo produzido dinamicamente, o servidor fornece um HTML pré-gerado, que é o conteúdo que o usuário vê em seu navegador. Muitas vezes, tais URLs serão URLs AJAX, ou seja, URLs contendo um fragmento de hash, por exemplo www.seusite.com.br/index.html#contato, onde #contato é o fragmento hash. O HTML pré-gerado é todo o conteúdo que aparece na página após a JavaScript ter sido executado.</li>\n  <li>O motor de busca irá indexar o  HTML pré-gerado e servirá suas URLs AJAX originais nos resultados de busca.</li>\n</ol>\n\n<p>A fim de fazer este trabalho, o aplicativo deve usar uma sintaxe específica na URLs AJAX (vamos chamá-los de "URLs bonita"). O mecanismo de busca vai modificar temporariamente a "URLs bonita" em "URLs feia" que será solicitada ao seu servidor. Este pedido de uma "URL feia" indica ao servidor que ele não deve retornar a página web que daria para um navegador, mas sim um HTML pré-gerado.</p>\n\n<p>Quando o rastreador obtiver o conteúdo de uma "URL feia", ele indexa seu conteúdo, em seguida, exibe a URL original nos resultados da pesquisa. Em outras palavras, os usuários finais vão sempre ver o URL bonita contendo um fragmento hash. O diagrama a seguir resume o acordo:</p>\n\n<img src="assets/funcionamento_seo_js.png" class="blockCenter">\n')
